script: |
  super -f text -I q6632.spq | sort > q6632.out

inputs:
  - name: q6632.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN col0 AND + col2 * 40 * + col1 + col1 / - ( - col0 ) + - ( + col2 ) + - + col1;
  - name: tab2

outputs:
  - name: q6632.out
    data: |
